      CameraDescription camara,
    )?
    camaraInicializada,
    TResult Function()? camaraSinPermisos,
    TResult Function(String mensaje)? camaraError,
    required TResult orElse(),
  }) {
    if (camaraError != null) {
      return camaraError(mensaje);
    }
    return orElse();
  }

  @override
  @optionalTypeArgs
  TResult map<TResult extends Object?>({
    required TResult Function(Inicial value) inicial,
    required TResult Function(Inicializando value) camaraInicializando,
    required TResult Function(Inicializada value) camaraInicializada,
    required TResult Function(SinPermisos value) camaraSinPermisos,
    required TResult Function(Error value) camaraError,
  }) {
    return camaraError(this);
  }

  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult? Function(Inicial value)? inicial,
    TResult? Function(Inicializando value)? camaraInicializando,
    TResult? Function(Inicializada value)? camaraInicializada,
    TResult? Function(SinPermisos value)? camaraSinPermisos,
    TResult? Function(Error value)? camaraError,
  }) {
    return camaraError?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(Inicial value)? inicial,
    TResult Function(Inicializando value)? camaraInicializando,
    TResult Function(Inicializada value)? camaraInicializada,
    TResult Function(SinPermisos value)? camaraSinPermisos,
    TResult Function(Error value)? camaraError,
    required TResult orElse(),
  }) {
    if (camaraError != null) {
      return camaraError(this);
    }
    return orElse();
  }
}

abstract class Error implements CamaraState {
  const factory Error(final String mensaje) = _$ErrorImpl;

  String get mensaje;

  /// Create a copy of CamaraState
  /// with the given fields replaced by the non-null parameter values.
  @JsonKey(includeFromJson: false, includeToJson: false)
  _$$ErrorImplCopyWith<_$ErrorImpl> get copyWith =>
      throw _privateConstructorUsedError;
}
